function getBookingInformation($res, $adult, $child)
{
	$publish_fare = [];
	
	$journeys = $res->GetBookingFromStateResult->Journeys->Journey;
	if ($journeys instanceOf stdClass) $journeys = array($journeys);
	
	foreach ($journeys as $journey_val) {
		$segments = $journey_val->Segments->Segment;
		if ($segments instanceOf stdClass) $segments = array($segments);
		
		foreach ($segments as $segment_val) {
			$paxfares = $segment_val->Fares->Fare->PaxFares->PaxFare;
			if ($paxfares instanceOf stdClass) $paxfares = array($paxfares);
			
			foreach ($paxfares as $paxfare_val) {
				
				$bookingservices = $paxfare_val->ServiceCharges->BookingServiceCharge;
				if ($bookingservices instanceOf stdClass) $bookingservices = array($bookingservices);
				
				$pax_type = $paxfare_val->PaxType;
				$pax_type = (string) $pax_type;
				
				foreach ($bookingservices as $bookingservice_val) {
					
					if ($bookingservice_val->ChargeType == 'FarePrice') {
						$publish_fare[$pax_type] += (float) $bookingservice_val->Amount;
					}
				}
			}
		}
	}
	
	$publishprice = $publish_fare['ADT'] * (int) $adult;
	if ($child) $publishprice += $publish_fare['CHD'] * (int) $child;
	
	return $publishprice;
}

